async def aio_htttp():
   try: 
        while True:
           async with aiohttp.ClientSession() as session:
               async with session.patch(url, data=b'data') as resp2:
                  print(resp2.status)        
   except socket.error as e:
        print("site is Down: _____",e,"_____")          

def Http():
  asyncio.run(aio_htttp())  

